	package important;

public class Pattern_Program2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

     	/*
		 * output : 1 2 3
		 * 
		 *          1 2 3         3 row 3 Column
		 * 
		 *          1 2 3
		 */		            
		
		
	 	for (int i = 1; i <=3; i++) {           //-----> row
			
			for (int j = 1; j <=3; j++) {      //----->column
				
				System.out.print(j+" ");       //i,j customized data
				
			}
			
			System.out.println();
		}
		
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	}

}
